import React from 'react';

function Sidebar() {
  return (
    <div className="sidebar fixed-left">
      {/* Logo and nav */}
      <div className="px-3 py-4 bg-dark text-white">
        <div className="text-3xl font-weight-bold">Travel</div>
        <nav className="mt-4">
          <a href="#" className="text-white">
            Home
          </a>
          <a href="#" className="text-white">
            Shop
          </a>
        </nav>
      </div>
    </div>
  );
}

export default Sidebar;
